import React from 'react';

function App(){
  return(
    <div className="container">
      <div className="card col-6">
        <div className="card-header">Body Mass Index</div>
        <div className="card-body">
          <p>Berat</p>
          <input className="form-control" name="berat" value="50" />
          <p>Tinggi</p>
          <input className="form-control" name="tinggi" value="170" />
        </div>
        <div className="card-footer">test</div>
      </div>
    </div>
  );
}

export default App;
